 Creek, CMC','Home to CMC via DTC, Rosemary Way, Princeton, Quincy, Holly, Dry Creek 3-26-2008.png',NULL,NULL),(19,3,5500,'Sucks. Riding along Belleview is a nightmare. 8.04 miles ',8.04,'Centennial/GreenwoodVillage','Commute CMC to Village via Dexter/Belleview','Commuting CMC to Village via Dexter-Belleview 4-24-2008.png','Profile CMC to Village via Dexter-Belleview Elevation-Time 4-24-2008.png',NULL),(20,2,5300,'CMC to Kipling/Kentucky',16.5,'Centennial/Lakewood','CMC to Gordon\'s old house','Road CMC to Gordon\'s house and back 9-7-2007.png','Profile CMC to Gordon\'s House and Back 9-7-2007, Elevation - Time.png',NULL),(30,0,5250,'parked at Slaven Elementary and rode down the Platte to C470 to Kipling and then up Deer Creek.',26,'Deer Creek','Deer Creek from Slaven Elementary','Denver to Deer Creek Canyon 6-8-2008.png','Denver to Deer Creek Canyon 6-8-2008, Elevation - Distance.png',7400),(21,4,5260,'Rode from home to Redrocks park. Route was was west on Dartmouth, south on Platte, west on Bear Creek to Kipling. Then north on Kipling to Jewel and then over the Hogback and across highway 8 to RedRocks park. Lots of activity at Redrocks. ',50,'Denver to Morrison','Home to Redrocks and back','Home to Red Rocks and back 4-27-2008.png','Home to Red Rocks and back 4-27-2008, Elevation - Time.png',6486),(22,2,5280,'along Cherry Creek bike path mostly',14,'Denver','Home to Wash Park','Home to Wash Park and back 5-11-2008.png','Home to Wash Park and back 5-11-2008, Elevation - Distance.png',5540),(23,2,5460,'CMC to Village direct, then rode around Cherry Creek res. Stopped at Bicycle Village',16.5,'Centennial, Denver','CMC to Village, Cherry Creek Res to home','CMC to Village then around the CC Reservior 5-9-2008.png','CMC to Village then rode around the CC Reservior 5-9-2008, Elevation - Distance.png',5720),(24,0,5480,'Home to CC path to CC Dam path, to Village',11.5,'Greenwood Village/Centennial','Home to Village Then CMC via CC Dam Bike path, Orchard','Home to Village 