d south. I ended up riding down the shoulder of 285 and then on the C470 trail back to Kipling. Could have been  worse I guess. ',43,'Jeffco','Highgrade wwrong turn at Twin Forks','HighGrade loop with Wrong Turn 6-15-2008.png','HighGrade loop with Wrong Turn 6-15-2008, Elevation - Distance.png',8500),(36,0,5200,'with Harvey Gish and Daryll Loud',49,'Denver','Cappucino Loop','Cappucino Loop Shortcutted at Big Dry Creek off of Platte 6-14-2008.png','Cappucino Loop Shortcutted at Big Dry Creek off of Platte 6-14-2008, Elevation - Distance.png',5500),(37,0,6100,'Rode up to Red Mesa and did two CW loops, then CCW around Plymouth Mt and down to the parking lot.',11.46,'Jeffco','Deer Creek Red Mesa Double, Plymouth Mt','Deer Creek Red Mesa Plymouth Mt 6-18-2008 - Medium.png','Deer Creek Red Mesa Plymouth Mt 6-18-2008, Elevation - Distance.png',7450),(38,0,5500,'long path except for shortcuts at Colorado.',20,'Denver/Centennial','CMC to Home via HLC longpath','CMC to Home via HLC with shortcuts 3-26-2008.png','',5600),(39,1,5500,'Complicated route down South Yosemite and through neighborhoods. Goes over Englewood dam',6.67,'Greenwood Village/Centennial','Village to CMC via S. Yosemite','commute village to cmc via s. Yosemite route 6-20-2008.png','commute village to cmc via s. Yosemite route 6-20-2008, Elevation - Distance.png',5600),(40,0,5500,'Click here to enter description',5.56,'Denver/Greenwood Village','Home to Village via 225 bike path','Commute Home to Village pulling kids in trailer 6-20-2008.png','Commute Home to Village pulling kids in trailer 6-20-2008, Elevation - Distance.png',4600),(41,1,5500,'view of street names',6.67,'Greenwood Village/Centennial','Village to CMC via S. Yosemite DETAIL','commute village to cmc via s. Yosemite route - detail 6-20-2008','',5600),(42,0,5460,'Click here to enter description',4,'Denver','Home to CC Res Beach','Riding with Kids-Home to CC Res beach. 6-21-2008.png','Riding with Kids-Home to CC Res beach. 6-21-2008, Elevation - Distance.png',5660),(43,2,5550,'40 miles. Up Deer Creek and Highgrade, Conifer, Aspen Park, right at N Turkey Creek, right at Twin Forks, left at the firestation to return on Deer Creek',40,'Jeffco','Highgrade loop ','Highgrade loop 7-2-2008.png','Highgrade loop 7-2-2008, Elevation - Distance.png',8550),(44,2,7000,'about 35 miles up. I rode to mile 8 (out of 14) but got turned back because of the  Hailstorm from Hell. ',35,'Jeffco','Evergreen to Mt. Evans','Mt. Evans Ascent from Evergreen 7-6-2008.png','Mt. Evans Ascent from Evergreen 7-6-2008, Elevation - Distance.png',14277),(46,1,7833,'Evergreen to Avon: 120 miles',120,'Evergree to Avon Colorado','Triple Bypass 2008','Triple Bypass 2008 7-12-2008.png','Triple Bypass 2008 7-12-2008, Elevation - Distance.png',12000),(47,3,5150,'rode down Wads, down Little Dry Creek. Then down Pecos, but had to turn back due to a stopped coal train. The rest of the ride was first through nasty industrial and scary part of Platte trail, then Cherry Creek path to home.',30,'Broomfield/Denver','Bike from Vidiom home','Vidiom to home via nasty industrial part of Denver 9-11-2008.png','Vidiom to home via nasty industrial part of Denver 9-11-2008, Elevation - Distance.png',5500),(48,0,5100,'Click here to enter description',30,'Golden/Denver','Gordons house to Lowry','Gordon\'s house to Logan School via Clear Creek and Sand Creek 9-7-2008.png','Gordon\'s house to Logan School via Clear Creek and Sand Creek 9-7-2008, Elevation - Distance.png',5600),(49,0,33323,'test',85,'denver','test image display','Denver to Deer Creek Canyon 6-8-2008.png','',3333);
