INSERT INTO `devel_issue` VALUES (1,0,'biometrics can\'t have null values','BioMetrics','BioMetric null values',3,'open'),(2,1,'deleting objects throws','Food','object deletion throws',5,'closed'),(3,1,'not-null property references a null or transient value: Food.description; ','Food','can\'t delete Food',5,'RESOLVED'),(31,0,'acegi plugin provides user role support','User','user roles',5,'OPEN'),(5,0,'log4j warns not configured correctly','config','log4j configuration',4,'open'),(6,1,'contact us email','maintenance','contact us',5,'open'),(7,2,'devel issue status enums','DevelIssue','issue status enum',5,'RESOLVED'),(8,1,'user superclass,coach, athlete subclasses','Athlete','User subclassing',5,'RESOLVED'),(10,3,'org.springframework.orm.hibernate3.HibernateObjectRetrievalFailureException: No row with the given identifier exists: [NutritionData#1]; nested exception is org.hibernate.ObjectNotFoundException: No row with the given identifier exists: [NutritionData#1]','FoodRef','FoodRef exception upon create',5,'CLOSED'),(11,1,'Can\'t click on FoodRef','FoodRef','FoodRef exception when clicked',5,'closed'),(12,2,'database maintenance utility. Probably us liquibase. Dbmigrate had issues.','config','gorm utilities',3,'open'),(13,0,'enumerations in grails','','enumerations howto',5,'open'),(14,2,'constraint closure in class should configure the order in the list view, but doesn\'t','constraint doesn\'t enforce ordering of attributdes','grails',5,'CLOSED'),(15,0,'Devel issue tree view','DevelIssue','DevelIssue tree view',5,'open'),(16,1,'button to add new food when in food ref','FoodRef','new food button on FoodRef',5,'closed'),(17,0,'increase list length','All','increasd list length',5,'open'),(18,0,'Use the flash object to return from the creation of an new food or exercise','ExerciseRef and FoodRef','flash object for redirect return',5,'open'),(19,1,'deleting doesn\'t work','all','delete does nothing',5,'closed'),(20,0,'use flash scope when creating a food from food reference and from meal creation','Meal','use flash scope',5,'OPEN'),(21,1,'implement inline edit like in dgg.\nGot this working in DevelIssue view, but not in other domains. Also some problems with saving. ','in description fields.','inline edit',5,'OPEN'),(22,0,'When listing a domain, provide a show all instead of the pageinate view','DevelIssue, Workout, meal','show all option',5,'OPEN'),(23,1,'When entering domain data from another controller, the controller context should be passed in so the user doesn\'t have to select the Athlete for example.','all','controller context persistance',3,'OPEN'),(24,2,'When creating an exercise ref, it should know what workout it is belongs to, so the user doesn\'t have to select a workout. \nSame for meal, and Athlete, etc','Workout, exercise ref.','New Workout object session persistance',5,'OPEN'),(25,0,'save workout when user selects add Exercise Ref','workout','auto save workout upon ExRef create.',2,'OPEN'),(26,0,'The \"mail the development team\" link extends into the milestones/roadmap part','index.gsp','limit contact us string',5,'OPEN'),(27,2,'displays only \"saving\". Wtf. Seems to work for new devel issues, but some fail. ','','cant save editInPlace',5,'OPEN'),(28,2,'follow article on securing grails app.\nhttp://www.infoq.com/articles/grails-acegi-integration\nNOTE: The article describes the integration of several new user related domains which will change the app architecture considerably. ','security','integrate acegi plugin',2,'OPEN'),(29,1,'in Workout, editInPlace only implemented in list view, but it can\'t be saved. Displays \"saving...\" but fails with no error.\n\nThis all works in DevelIssue.','workout','editInPlace won\'t save in Workout',5,'OPEN'),(30,1,'acegi plugin will work well for this. Also provides roles.','user','secure user login',5,'OPEN'),(32,0,'So they can be punch listed','DevelIssue','pretty print devel issues',2,'OPEN'),(33,0,'When registering a user, the acegi register controller fails because the captcha object is null. The one from the user form is good, but it is compared with the one from the captcha generator, but it\'s null and the registration fails','acegi','acegi registration broken',5,'OPEN'),(34,0,'throws exception relating to dates','User/AuthUser','UserController can\'t update user1',5,'OPEN'),(35,0,'when a food is deleted, any foodRefs must be deleted too. If not you get a weird error about nutrition data missing rows. ','food, foodRef, delete','delete food must delete foodRefs too',5,'OPEN'),(36,0,'Create a superclass called activity and subclass Exercise','Exercise','subclass Exercise from Activity domain',1,'OPEN'),(37,0,'for backup, and restore as well as manipulation','Workout','export workout to xml',3,'OPEN'),(38,0,'Human readable format','DevelIssue','export devel issues as report',3,'OPEN'),(39,0,'meals and workouts should list from most recent first. ','meal, workout','default lists should be in reverse chronological order',5,'OPEN'),(40,0,'example: When choosing from the food dropdown list in the foodRef create action, the food items should be listed in order of frequency of occurence.','food, exercise','lists based on frequency of reference occurence',5,'OPEN'),(41,0,'since we can\'t migrate easily, a way to read in xml and populate the date','app','load coach data from xml',5,'OPEN'),(42,0,'you get a reference integrity error from Equipment ref (hibernate','Exercise, Equipment','can\'t delete exercise',5,'OPEN'),(46,0,'Click here to enter description','http://coach.summitbid.com/','happyguy',5,'OPEN');
